import Link from 'next/link'

function Navbar() {
  return (
    <nav style={navStyle}>

      <Link href='/'>
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href='/about'>
        <a style={linkStyle}>About</a>
      </Link>

    </nav>
  )
}

const linkStyle = {
  textDecoration: 'none',
  weight: 'bold',
  color: '#ffffff',
  marginRight: '15px',
}

const navStyle = {
  backgroundImage: linear-gradient('120deg, transparent 0%, transparent 50%, #5643fa 50%'),
  textAlign: 'right',
  padding: '10px',
  color: '#ffffff'
}

export default Navbar
